window.bookSummaryJSON = "<p>He'll never let me go. I'll never stop running. When the bratva try to get me to throw my championship fight, I flip them one middle finger and decimate their candidate. I knew my actions wouldn't go unpunished, but I didn't care. I'm unbreakable.</p> <p>I’m surrounded, outmanned, outgunned and I'm ready to fight my way out.</p> <p>I think I’m all alone until a familiar, deep British voice says, “Play fair now. The lady gets to beat you, one at a time.”</p> <p>My one-night-stand has deep connections I knew nothing about, and he's willing to start a war just to get me where he wants me.</p>"; 
